import React from "react";
import {
  Box,
  Card,
  CardActions,
  Link,
  CardContent,
  CardMedia,
  Button,
  Typography,
} from "@mui/material";

const Logincomponent1 = () => {
  return (
    <Box classNmae="">
      <Card>
        <CardContent>
          <Typography
            className="Go_foodName text_NameFood"
            gutterBottom
            variant="small"
            component="div"
          >
            Login/Sign up
          </Typography>
        </CardContent>
      </Card>
    </Box>
  );
};

export default Logincomponent1;
